import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import Card from './Card'; 
import robots from './robots';

ReactDOM.render(

  <div>{
    <Card/>
    /*
  	<Card id={robots[0].id} name={robots[0].name} email={robots[0].email} />
  	<Card id={robots[1].id} name={robots[0].name} email={robots[1].email} />
  	<Card id={robots[2].id} name={robots[0].name} email={robots[2].email} />
  	<Card id={robots[3].id} name={robots[0].name} email={robots[3].email} />
  	<Card id={robots[4].id} name={robots[0].name} email={robots[4].email} />
  	<Card id={robots[5].id} name={robots[0].name} email={robots[5].email} />*/}
  </div>

  ,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
